import React from 'react';

function add(a,b){
    let d=a+b;
    return d;
}



function sub(a,b){
    let d=a-b;
    return d;
}



function div(a,b){
    let d=a/b;
    d=d
    return d;
}



function multiply(a,b){
    let d=a*b;
    return d;
}

export {add,sub,div,multiply};
